import React from 'react';
import './EventDeck.css';

const EventDeck = () => {
  return (
    <div className="event-deck">
      <div className="event-cards-stack">
        <div className="event-card">
          <img 
            src={require('../assets/evenements/evenement-verso.png')} 
            alt="Carte événement" 
          />
        </div>
      </div>
      <div className="memo-cards">
        <div className="memo-card">
          <img 
            src={require('../assets/evenements/memo-1.png')} 
            alt="Fiche mémo 1" 
          />
        </div>
        <div className="memo-card">
          <img 
            src={require('../assets/evenements/memo-2.png')} 
            alt="Fiche mémo 2" 
          />
        </div>
      </div>
    </div>
  );
};

export default EventDeck;
